// client/src/GoldExchange.js
import React, { useState } from 'react';

function Sell({ onSell }) {
    const [resourceType, setResourceType] = useState('');
    const [Wood, setWood] = useState(0);
    const [Iron, seIron] = useState(0);
    const [Bread, setBread] = useState(0);
    const [WoodPraice, setWoodPraice] = useState(0);
    const [IronPraice, seIronPraice] = useState(0);
    const [BreadPraice, setBreadPraice] = useState(0);
    const handleSell = (resourceType, amount) => {
        onSell(resourceType, amount);
    };

    return (
        <div>
            <h2>Sell your resources</h2>
            <div>
                <label htmlFor="amount">Amount to Wood:</label>
                <input
                    type="number"
                    id="wood"
                    value={Wood}
                    onChange={(e) => setWood(parseInt(e.target.value))}
                />
                <label htmlFor="amount">Praice:</label>
                <input
                    type="number"
                    id="woodPraice"
                    value={WoodPraice}
                    onChange={(e) => setWoodPraice(parseInt(e.target.value))}
                />
            </div>
            <div>
                <label htmlFor="amount">Amount to Wood:</label>
                <input
                    type="number"
                    id="wood"
                    value={Wood}
                    onChange={(e) => setWood(parseInt(e.target.value))}
                />
                <label htmlFor="amount">Praice:</label>
                <input
                    type="number"
                    id="woodPraice"
                    value={WoodPraice}
                    onChange={(e) => setWoodPraice(parseInt(e.target.value))}
                />
            </div>
            <button onClick={() => handleSell(resourceType, Wood)}>confirm</button>
        </div>
    );
}
export default Sell;
